import React from 'react';

interface IProduct{
    sno:string;
    name:string;
    image:string;
    price:number;
    qty:number;
}
interface IProps {}

interface IState {
    products:IProduct[]
}

class ShoppingCart extends React.Component<IProps, IState>{

    constructor(props:IProps) {
        super(props);
        this.state={
            products:[
                {
                    sno:'AA101',
                    name:'Mi Watch',
                    image:'',
                    price:1500,
                    qty:2,
                },
            ]
        }
    }


    render() {
        return (
            <React.Fragment>
                <h1>ShoppingCart component</h1>
            </React.Fragment>
        );
    }
}
export default ShoppingCart;
